import { Box, Stack, Button, Center  } from '@chakra-ui/react';
import { useState } from 'react';

function App() {

const [one, setOne] = useState('#81ecec')
const [two, setTwo] = useState('#74b9ff')
const [three, setThree] = useState('#a29bfe')
const [four, setFour] = useState('#00cec9')
const [five, setFive] = useState('#0984e3')
const [six, setSix] = useState('#6c5ce7')
const [seven, setSeven] = useState('#fab1a0')
const [eight, setEight] = useState('#ff7675')
const [nine, setNine] = useState('#fd79a8')


 function handleClick (arg){
    console.log('Clicked', arg)
  }

  return (
    <Box justifyItems='center'>
      <Stack spacing={0} direction='column'>
        <Stack spacing={0} direction='row'>
          <Center  w="100%" backgroundColor={one}>
            <Button colorScheme={one} variant="link" key='asd' color="white" fontSize='x-large' w='100%' p='15vh' onClick={handleClick}> {one} </Button>
          </Center >
          <Center  w="100%" backgroundColor={two}>
            <Button colorScheme={two} variant="link" color="white" fontSize='x-large'  w='100%' p='15vh' onClick={handleClick}> {two} </Button>
          </Center >
          <Center  w="100%" backgroundColor={three}>
            <Button colorScheme={three} variant="link" color="white" fontSize='x-large'  w='100%' p='15vh' onClick={handleClick}> {three} </Button>
          </Center > 
        </Stack>

        <Stack spacing={0} direction='row'>
          <Center  w="100%" backgroundColor='#00cec9'>
            <Button colorScheme="#00cec9" variant="link" color="white" fontSize='x-large' w='100%' p='15vh' onClick={handleClick}> {four} </Button>
          </Center >
          <Center  w="100%" backgroundColor='#0984e3'>
            <Button colorScheme="#0984e3" variant="link" color="white" fontSize='x-large'  w='100%' p='15vh' onClick={handleClick}> {five} </Button>
          </Center >
          <Center  w="100%" backgroundColor='#6c5ce7'>
            <Button colorScheme="#6c5ce7" variant="link" color="white" fontSize='x-large'  w='100%' p='15vh' onClick={handleClick}> {six} </Button>
          </Center > 
        </Stack>

        <Stack spacing={0} direction='row'>
          <Center  w="100%" backgroundColor='#fab1a0'>
            <Button colorScheme="#fab1a0" variant="link" color="white" fontSize='x-large' w='100%' p='15vh' onClick={handleClick}> {seven} </Button>
          </Center >
          <Center  w="100%" backgroundColor='#ff7675'>
            <Button colorScheme="#ff7675" variant="link" color="white" fontSize='x-large'  w='100%' p='15vh' onClick={handleClick}> {eight} </Button>
          </Center >
          <Center  w="100%" backgroundColor='#fd79a8'>
            <Button colorScheme="#fd79a8" variant="link" color="white" fontSize='x-large'  w='100%' p='15vh' onClick={handleClick}> {nine} </Button>
          </Center > 
        </Stack>
      </Stack>
    </Box>
  );
}

export default App;
